INSERT INTO `wst_product_description` VALUES (50,1,'AEM Electronics Engine Position Module','&lt;p&gt;&lt;span style=&quot;color: rgb(77, 79, 91); font-family: Helvetica, Arial, sans-serif; font-size: 16px;&quot;&gt;AEM\'s Engine Position Module (EPM) replaces an engine\'s distributor and allows for the use of coil-on-plug or wasted-park ignition systems on popular V8 and Honda B-, D-, H-, and F-series race engines. It provides precise engine position using dual zero-speed optical sensors, which offers the advantage of immediate signal generation regardless of engine speed. The EPM easily adapts to any positive-drive, half-engine speed device such as a cam or distributor drive, and can be used with any aftermarket engine management system that recognizes the common 24 &amp;amp; 1 pattern for crank and cam signals.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','AEM','',''),(51,1,'Nissan Genuine OEM 300ZX VG30DE(TT) Lower Timing Belt Idler Pulley','&lt;p&gt;&lt;span style=&quot;color: rgb(77, 79, 91); font-family: Helvetica, Arial, sans-serif; font-size: 16px;&quot;&gt;This part is recommended when replacing any part of your timing components. It ensures proper tension on belts and regular idling.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;','','Nissan Genuine OEM 300ZX VG30DE(TT) Lower Timing Belt Idler Pulley','',''),(52,1,'AEM Electronics Engine Position Module','&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&lt;strong style=&quot;line-height: inherit;&quot;&gt;AEM 30-3255 Engine Position Module&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;AEM\'s Engine Position Module (EPM) replaces an engine\'s distributor and allows for the use of coil-on-plug or wasted-park ignition systems on popular V8 and Honda B-, D-, H-, and F-series race engines. It provides precise engine position using dual zero-speed optical sensors, which offers the advantage of immediate signal generation regardless of engine speed. The EPM easily adapts to any positive-drive, half-engine speed device such as a cam or distributor drive, and can be used with any aftermarket engine management system that recognizes the common 24 &amp;amp; 1 pattern for crank and cam signals.&lt;/p&gt;','','AEM Electronics Engine Position Module','',''),(53,1,'APEXi Power FC Engine Management 99-02 S15 SR20DET D-Jetro','','','APEXi Power FC','',''),(54,1,'AEM Electronics Series 2 Plug &amp; Play EMS Engine Mgmt S13 SR20DET','&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&lt;strong style=&quot;line-height: inherit;&quot;&gt;AEM 30-6601 Series 2 Plug &amp;amp; Play EMS Engine Mgmt S13 SR20DET&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;AEMs Series 2 Programmable Engine Management System is more powerful than its predecessor. In addition to more robust hardware, there are several improvements over the original EMS, noted in the chart below. Like its predecessor, AEM\'s Series 2 Plug &amp;amp; Play EMS plugs directly into a vehicle\'s factory ECU harness and requires no additional wiring or hardware. Windows compatible software (2000, XP, NT, 98, 95, ME) makes the task of copying, viewing and manipulating data as simple as a click of the mouse. Our new AEMTUNER software is infinitely adjustable software and allows tuners to program virtually any combination of engine control, power adders and auxiliary devices, and accurately delivers proper amounts of fuel and correct ignition timing for any boost level or operating condition.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;b style=&quot;line-height: inherit;&quot;&gt;Legal in California only for racing vehicles which may never be used upon a highway.&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;u&gt;&lt;b style=&quot;line-height: inherit;&quot;&gt;SERIES 2 KEY FEATURES&lt;/b&gt;&lt;/u&gt;&lt;/p&gt;&lt;ul style=&quot;margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; list-style-position: outside; color: rgb(77, 79, 91);&quot;&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Plugs directly into the factory harness. No rewiring necessary.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Uses all the factory sensors.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Includes start up calibrations.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;System is fully enabled and unlocked - Never pay for upgrades!&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Context sensitive help eases tuning process.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Maps can be password protected by the tuner to prevent unauthorized usage or sharing.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Runs on Windows-compatible software.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Up to 12 peak and hold injector drivers.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Up to 8 direct-fire coil outputs.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Up to 16 general-purpose outputs.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Up to 8 definable switch inputs.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Up to 4 EGT inputs with fuel control.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;1MB of internal data logging.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Electronic boost control.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Full idle control.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Programmable traction control.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Software definable knock control.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Two step launch control.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;User configurable soft-cut rev limiters.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Wet or dry nitrous control.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Tune using new USB communication port or serial port.&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;Works with all AEM gauges.&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 1.25rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; text-rendering: optimizeLegibility; color: rgb(77, 79, 91);&quot;&gt;&lt;u&gt;&lt;strong style=&quot;line-height: inherit;&quot;&gt;AEM APPLICATION GUIDE:&lt;/strong&gt;&lt;/u&gt;&lt;/p&gt;&lt;ul style=&quot;margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; padding: 0px; font-family: Helvetica, Arial, sans-serif; font-size: 16px; line-height: 1.6; list-style-position: outside; color: rgb(77, 79, 91);&quot;&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;1996 to 1999 Nissan 180SX 2.0L Turbo&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;1991 to 1995 Nissan 180SX 2.0L Turbo&lt;/li&gt;&lt;li style=&quot;margin: 0px; padding: 0px;&quot;&gt;1991 to 1993 Nissan 240SX Swapped w/SR20 2.0L Turbo&lt;/li&gt;&lt;/ul&gt;','','AEM Electronics Series 2 Plug &amp; Play EMS Engine Mgmt S13 SR20DET','','');
/*!40000 ALTER TABLE `wst_product_description` ENABLE KEYS */;
UNLOCK TABLES;

